import { Component } from 'react'
import './distFCalculator.css'
class distFCalculator extends Component{
    constructor (props){
        super(props)
        this.state={
            valx1: null,
            valx2: null, 
            valy1: null,
            valy2: null
        }
    }
    render (){
        return(
            <form className='form'>
                <div className='center'>
                    <div className='title'>
                        <h1>Distance Formula: &#8730;(x&sup2;<sub>1</sub>-x<sub>2</sub>)+(y<sub>1</sub>-y<sub>2</sub>)</h1>
                    </div>

                    <div className='sentence'>
                        <div className='fillout'>
                            <h1 className='topEquation'>
                                -<input
                                    placeholder = 'b'
                                    type = 'number'
                                    value = {this.state.valB}
                                    onChange = {(e) => {this.setState({valB: e.target.value})}}
                                />
                                &#177;&#8730;(<input
                                    placeholder = 'b'
                                    type = 'number'
                                    value = {this.state.valB}
                                    onChange = {(e) => {this.setState({valB: e.target.value})}}
                                />&sup2;
                                -4<input
                                    placeholder = 'a'
                                    type = 'number'
                                    value = {this.state.valA}
                                    onChange = {(e) => {this.setState({valA: e.target.value})}}
                                />
                                <input
                                    placeholder = 'c'
                                    type = 'number'
                                    value = {this.state.valC}
                                    onChange = {(e) => {this.setState({valC: e.target.value})}}
                                />)
                            </h1>
                            <h1>2<input
                                    placeholder = 'a'
                                    type = 'number'
                                    value = {this.state.valA}
                                    onChange = {(e) => {this.setState({valA: e.target.value})}}
                                /></h1>
                        </div>
                    </div>

                    <div>
                        <h1>Plus Output: {(-this.state.valB+Math.sqrt(this.state.valB**2-(4*this.state.valA*this.state.valC)))/(2*this.state.valA)}</h1>
                        <h1>Minus Output: {(-this.state.valB-Math.sqrt(this.state.valB**2-(4*this.state.valA*this.state.valC)))/(2*this.state.valA)}</h1>
                    </div>

                </div>
            </form>
        )
    }
}
export default distFCalculator
